        return (
            <div>
                <div class="fixed-header">
                    <div class="container">  
                        <nav>
                            <a> <span class="logo"> E-ShoppingZone</span></a>
                            <a >Home</a>
                            <a >Cart</a>
                            <a >Order</a>
                            <a href="#">Services</a>
                            <a href="#">login</a>
                        </nav>
                    </div>
                </div>
            </div>
        );
    }
}

export default HeaderComponent;
